mapper.select:

select 

from PIP_COMM_PATIENT_QC_DROP
where DROP_DATE = #{dropDate,jdbcType=TIMESTAMP}
  and ITEM_CODE = #{itemCode,jdbcType=VARCHAR}
  and LCC_CODE = #{lccCode,jdbcType=VARCHAR}
  and PATIENT_ID = #{patientId,jdbcType=VARCHAR}
  and PROJECT_ID = #{projectId,jdbcType=VARCHAR}

mapper.delete:

delete from PIP_COMM_PATIENT_QC_DROP
where DROP_DATE = #{dropDate,jdbcType=TIMESTAMP}
  and ITEM_CODE = #{itemCode,jdbcType=VARCHAR}
  and LCC_CODE = #{lccCode,jdbcType=VARCHAR}
  and PATIENT_ID = #{patientId,jdbcType=VARCHAR}
  and PROJECT_ID = #{projectId,jdbcType=VARCHAR}

mapper.update:

update PIP_COMM_PATIENT_QC_DROP
set START_TIME = #{startTime,jdbcType=TIMESTAMP},
  END_TIME = #{endTime,jdbcType=TIMESTAMP},
  CREATE_DATE = #{createDate,jdbcType=TIMESTAMP},
  UQSIS_HOLD = #{uqsisHold,jdbcType=DECIMAL},
  UQS_REMARK = #{uqsRemark,jdbcType=VARCHAR},
  UQS_OPERATOR_ID = #{uqsOperatorId,jdbcType=VARCHAR},
  UQS_OPERATOR_NAME = #{uqsOperatorName,jdbcType=VARCHAR},
  UQS_FILE = #{uqsFile,jdbcType=VARCHAR},
  UQS_ZIPFILE = #{uqsZipfile,jdbcType=VARCHAR},
  OPERATOR_NAME = #{operatorName,jdbcType=VARCHAR},
  DROP_NUM = #{dropNum,jdbcType=DECIMAL}
where DROP_DATE = #{dropDate,jdbcType=TIMESTAMP}
  and ITEM_CODE = #{itemCode,jdbcType=VARCHAR}
  and LCC_CODE = #{lccCode,jdbcType=VARCHAR}
  and PATIENT_ID = #{patientId,jdbcType=VARCHAR}
  and PROJECT_ID = #{projectId,jdbcType=VARCHAR}
